script: |
  super -f text -I q2335.spq | sort > q2335.out

inputs:
  - name: q2335.spq
    data: |
      SELECT DISTINCT - col2 * tab1.col1 + + ( + col0 * tab1.col1 ) + + tab1.col0 * 68 AS col1 FROM tab1 (FORMAT parquet);
  - name: tab1

outputs:
  - name: q2335.out
    data: |
      -1122
      4422
      5232
